import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    Redirect,
    useHistory,
    useLocation
} from "react-router-dom";
import Home from './components/public/home';


const App = () => {
    return(
        <Router>
            <Switch>
                <Route path="/home">
                    <Home />
                </Route>

            </Switch>

        </Router>
    )
}

export default App;
